import React, { Component } from 'react'

export class HoverCounterTwo extends Component {


  render() {
    return (
      <div>
        <h2 onMouseOver={this.incrementCount}>Hovered {this.state.count} times</h2>
      </div>
    )
  }
}

export default HoverCounterTwo
